Развивающий куб-сортер со стихотворениями и песнями на стихи С. Маршака ТМ УМка.

С такой игрушкой главная задача малыша правильно подобрать игрушку к соответствующему отверстию - подсказками будут соотносящиеся между собой цвета, и, конечно же, сама форма игрушки. Куб-сортер воспроизводит 46 песен, стихотворений и звуков.

Обучающая игрушка "Развивающий куб-сортер со стихотворениями и песнями на стихи С. Маршака" ТМ "УМка" с функционалом 4 в 1:

- Игрушка с подвижными деталями;
- Со звуковым сопровождением: 2 русские народные сказки + 8 весёлых песен + 10 добрых стихотворений С. Маршака;
- Более 8-ми заданий: у куба развивающие ребёнка задания и интересные яркие объёмные детали на каждой из сторон;
- В весёлой игровой форме: учим цвета, формы, осваиваем методы логического мышления;

Размеры игрушки-сортера: 22,5 * 23,5 * 17 см.
Материал: пластмасса + металл;
Работает от 3-х батареек АА (пальчиковые).
Рекомендуем для детей от 1-го года.

Развивающий музыкальный проектор Три кота ТМ "УМка".
Эта яркая музыкальная игрушка понравится малышам: Учиться и играть ребёнка приглашают любимые котята из мультфильма "Три кота".
Развивающий музыкальный проектор "Три кота" ТМ "УМка" с функциями 5 в 5 в 1:
- Учим азбуку в стихах;
- 10 Фраз героев;
- 6 Песенок из мультфильма ("Три кота", "Три хвоста", "Тише, мыши" и другие);
- Со звуковыми эффектами: слушаем 50 любимых песенок, звуков и фраз персонажей;
- Очень компактная и удобная игрушка: простое управление (выбираем слайд - бабочки/персонажи, затем настраиваем отображение-фокусировку), работает от батареек.
Размеры музыкального проектора: 10,5 х 7,5 х 3,8 см.
Материал: пластмасса + металл.
Работает от 3-х батареек АА (пальчиковые).
Рекомендуем для детей от 3-х лет.

